choices.text:
if (dicRevision == 5 || dicRevision == 6)
{
    setCurrentAccessPermission(new AccessPermission(dicPermissions));
}
else
{
    setCurrentAccessPermission(new AccessPermission(dicPermissions & 0xFFFFFFFC));
}

AccessPermission ap = new AccessPermission();
ap.setReadOnly();
ap.setCanExtractContent(isExtractForAccessibilityAllowed(dicPermissions));
ap.setCanPrint(isPrintingAllowed(dicPermissions));
ap.setCanModify(false);
ap.setCanExtractForAccessibility(isExtractForAccessibilityAllowed(dicPermissions));
ap.setCanAssembleDocument(isAssemblyAllowed(dicPermissions));
ap.setCanModifyAnnotations(isModifyAnnotationsAllowed(dicPermissions));
ap.setCanFillInForm(isFillInAllowed(dicPermissions));
ap.setCanModify(isModifyAllowed(dicPermissions));
ap.setReadOnly();
setCurrentAccessPermission(ap);

